import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Card';
import './index.css';
import Sdata from './Sdata';

function tvfCard(val) {
  return (
    <Card
      simg={val.simg}
      sname={val.sname}
      stitle={val.stitle}
      slink={val.slink}
    />
  );
}
ReactDOM.render(
  <>
    <h1 className='heading'>TVF Best Web Series</h1>
    {Sdata.map(tvfCard)}
  </>,
  document.getElementById('root')
);
